var c1data = "data:image/png;base64,";

var c2data = "data:image/png;base64,";
var c3data = "data:image/png;base64,";
var c4data = "data:image/png;base64,";

var img1 = null;
var img2 = null;
var img3 = null;
var img4 = null;
var rootNode = null;
var repAction = null;

var icon1, icon2, icon3, icon4;
var icon_r1, icon_r2, icon_r3, icon_r4;
var lable1, lable2, lable3, lable4;

MyLoading = cc.Scene.extend({
    _interval: null,
    _length: 0,
    _count: 0,
    _label: null,
    _rootNode: null,
    _winSize: null,
    _className: "MyLoading",
    _processLayer: null,
    _processLayerLength: null,

    init: function() {
        var self = this;

        // bg
        var bgLayer = self._bgLayer = cc.LayerColor.create(cc.color(255, 255, 255, 255));
        bgLayer.setPosition(cc.visibleRect.bottomLeft);
        self.addChild(bgLayer, 0);

        //image move to CCSceneFile.js
        if (cc._loaderImage) {
            cc.loader.loadImg(c1data, {
                isCrossOrigin: false
            }, function(err, img) {
                img1 = img;
                self._initStage();
            });

            cc.loader.loadImg(c2data, {
                isCrossOrigin: false
            }, function(err, img) {
                img2 = img;
                self._initStage();
            });

            cc.loader.loadImg(c3data, {
                isCrossOrigin: false
            }, function(err, img) {
                img3 = img;
                self._initStage();
            });

            cc.loader.loadImg(c4data, {
                isCrossOrigin: false
            }, function(err, img) {
                img4 = img;
                self._initStage();
            });
        }

        //loading percent
        // var label = self._label = cc.LabelTTF.create("Loading... 0%", "Arial", fontSize);
        // label.setPosition(cc.pAdd(cc.visibleRect.center, cc.p(0, lblHeight)));
        // label.setColor(cc.color(180, 180, 180));
        // bgLayer.addChild(this._label, 10);

        // 定义进度条层
        // this._winSize = cc.director.getWinSize();
        // var centerPos = cc.p(this._winSize.width / 2, this._winSize.height / 2);
        // self._processLayerLength = 500;
        // self._processLayer = cc.LayerColor.create(cc.color(255, 100, 100, 128), 1, 30);
        // self._processLayer.setPosition(cc.pAdd(centerPos, cc.p(-this._processLayerLength / 2, -logoHeight / 2 - 50)));
        // self._bgLayer.addChild(this._processLayer);

        this._winSize = cc.director.getWinSize();
        console.log("this._winSize " + this._winSize);

        rootNode = new cc.Node();
        rootNode.setPosition(cc.p(this._winSize.width / 2, this._winSize.height / 2));
        self._bgLayer.addChild(rootNode);

        var scaleAction = cc.RotateTo.create(5, 720);
        repAction = cc.Repeat.create(scaleAction, 100);
        rootNode.runAction(repAction);

        return true;
    },

    _initStage: function() {

        if (img1 == null || img2 == null || img3 == null || img4 == null) {
            return;
        }
        var self = this;
        var dis = 150;

        var texture4 = new cc.Texture2D();
        texture4.initWithElement(img4);
        texture4.handleLoadedTexture();
        icon4 = cc.Sprite.create(texture4);
        icon4.x = -dis;
        icon4.y = 0;
        rootNode.addChild(icon4, 10);


        var texture3 = new cc.Texture2D();
        texture3.initWithElement(img3);
        texture3.handleLoadedTexture();
        icon3 = cc.Sprite.create(texture3);
        icon3.x = dis;
        icon3.y = 0;
        rootNode.addChild(icon3, 10);

        var texture2 = new cc.Texture2D();
        texture2.initWithElement(img2);
        texture2.handleLoadedTexture();
        icon2 = cc.Sprite.create(texture2);
        icon2.x = 0;
        icon2.y = -dis;
        rootNode.addChild(icon2, 10);

        var texture1 = self._texture2d = new cc.Texture2D();
        texture1.initWithElement(img1);
        texture1.handleLoadedTexture();
        icon1 = self._logo = cc.Sprite.create(texture1);
        icon1.x = 0;
        icon1.y = dis;
        rootNode.addChild(icon1, 10);


    },

    onEnter: function() {
        var self = this;
        cc.Node.prototype.onEnter.call(self);
        self.schedule(self._startLoading, 0.3);
    },

    onExit: function() {
        cc.Node.prototype.onExit.call(this);
        // var tmpStr = "Loading... 0%";
        this._label.setString(tmpStr);
    },

    /**
     * init with resources
     * @param {Array} resources
     * @param {Function|String} cb
     */
    initWithResources: function(resources, cb) {
        if (typeof resources == "string") resources = [resources];
        this.resources = resources || [];
        this.cb = cb;
    },

    _startLoading: function() {
        var self = this;
        self.unschedule(self._startLoading);
        var res = self.resources;
        self._length = res.length;
        self._count = 0;
        cc.loader.load(res, function(result, count) {
            self._count = count;
        }, function() {
            if (self.cb)
                self.cb();
        });
        self.schedule(self._updatePercent);
    },

    _updatePercent: function() {
        var self = this;
        var count = self._count;
        var length = self._length;
        var percent = (count / length * 100) | 0;
        percent = Math.min(percent, 100);
        // self._label.setString("Loading... " + percent + "%");

        // 更新进度条的长度
        // this._processLayer.changeWidth(this._processLayerLength * percent / 100);

        if (count >= length) {
            self.unschedule(self._updatePercent);
            self._startPlay();
        }

    },
    _startPlay: function() {
        console.log("_startPlay");
        icon1.runAction(cc.MoveTo.create(2, cc.p(0, 0)));
        icon2.runAction(cc.MoveTo.create(2, cc.p(0, 0)));
        icon3.runAction(cc.MoveTo.create(2, cc.p(0, 0)));
        var seq = cc.sequence(cc.MoveTo.create(2, cc.p(0, 0)), cc.callFunc(step1));
        icon4.runAction(seq);

        // icon4.runAction(cc.sequence( cc.moveBy(5, -50, 0), cc.moveBy(2, 0, 200), cc.callFunc(test, this)));
    },
    startAll: function() {
        console.log("_startShow");
    },
});

