    label2.setOpacity(opa);
    label2.setAnchorPoint(cc.p(1, 0.5));
    rootNode.addChild(label2, 10);

    label3 = cc.LabelTTF.create("美丽的大草原\n美丽的大草原", "Arial", fontSize);
    label3.setPosition(icon_r3.x + 30, icon_r3.y - 50);
    label3.setColor(cc.color(180, 180, 180));
    label3.setOpacity(opa);
    label3.setAnchorPoint(cc.p(0, 0.5));
    rootNode.addChild(label3, 10);


    label4 = cc.LabelTTF.create("美丽的大草原\n美丽的大草原", "Arial", fontSize);
    label4.setPosition(icon_r4.x - 30, icon_r4.y - 50);
    label4.setColor(cc.color(180, 180, 180));
    label4.setOpacity(opa);
    label4.setAnchorPoint(cc.p(1, 0.5));
    rootNode.addChild(label4, 10);

    var action = cc.EaseSineOut.create(cc.MoveBy.create(1.5, cc.p(0, 400)), 100);
