MyLoading.preload = function(resources, cb) {
    var _cc = cc;
    if (!_cc.myLoading) {
        _cc.myLoading = new MyLoading();
        _cc.myLoading.init();
    }
    _cc.myLoading.initWithResources(resources, cb);

    cc.director.runScene(_cc.myLoading);
    return _cc.myLoading;
};
